import React from "react";
import Helmet from "../components/Helmet";
import Hello from "../assets/image/About/xinchao.png"

function About() {
  return (
  <div className="whole">
    <div className="whole__part1">
      
      <img src={Hello} alt="" />
    </div>

  </div>
)}

export default About;
